            email:req.body.email,
            phone:req.body.phone,
            job:req.body.job
        })
        const newUser = await user.save();
        if(newUser){
            res.send({message:'Penyimpanan data berhasil dilakukan !'})
        }
    }catch(error){
        res.send({message:error})
    }
})

